import { React, useEffect, useState } from "react";
// import {}
import "./styles.css";

const HomeOverview = () => {
  const [movieObj, setMovieObj] = useState("");

  useEffect(() => {
    fetch("/latest")
      .then((response) => response.json())
      .then((data) => {
        setMovieObj(data);
      });
  }, []);

  return (
    <>
      <div className="home-overview-container">
        <div className="overview-new-container">
          <div className="overview-new-header">{`New Release: ${movieObj.original_title}`}</div>
          <div className="overview-new-content">
            <img
              className="overview-new-poster"
              src={movieObj.poster_path}
              alt=""
            />
          </div>
        </div>
      </div>
    </>
  );
};

export default HomeOverview;
